INSERT INTO `config_info` VALUES (4163, 'application-dev.yml', 'DEFAULT_GROUP', '\nspring:\n  #避免nacos取网卡出错\n#   cloud:\n#     inetutils:\n#       preferred-networks: 192.168.1\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    type: com.zaxxer.hikari.HikariDataSource\n    hikari:\n      minimum-idle: 0\n      maximum-pool-size: 20\n      idle-timeout: 25000\n      auto-commit: true\n      connection-test-query: SELECT 1\n  redis:\n    host: aliyun.xiaowenhao.ren\n    password: 4234\n  jackson:\n    date-format: yyyy-MM-dd HH:mm:ss\n    time-zone: GMT+8\n      \n#mybatis的相关配置\nmybatis:\n  #mapper配置文件\n  mapper-locations: classpath:mapper/*Mapper.xml\n  type-aliases-package: com.haolinmeng.cloud.**.model\n  #开启驼峰命名\n  configuration:\n    map-underscore-to-camel-case: true\n\n# seata:\n#   # tx-service-group: my_test_tx_group\n#   # config:\n#   #   type: nacos\n#   #   nacos:\n#   #     namespace: \"\"\n#   #     server-addr: ${spring.cloud.nacos.discovery.server-addr}\n#   #     password: ${spring.cloud.nacos.discovery.password}\n#   #     username: ${spring.cloud.nacos.discovery.username}\n#   registry:\n#     type: nacos\n#     nacos:\n#       server-addr: ${spring.cloud.nacos.discovery.server-addr}\n#       username: ${spring.cloud.nacos.discovery.username}\n#       password: ${spring.cloud.nacos.discovery.password}\n#       namespace: \"\"\n#       group: DEFAULT_GROUP\n#       application: hlmcloud-seata\n#   tx-service-group: seata-demo\n#   service:\n#     vgroup-mapping:\n#       seata-demo: default\n\nlogging:\n  level:\n    root: info\n    com:\n      hlmcloud:\n        shop: debug\n# 分页合理化，当查询到页码大于最后一页的时候，返回最后一页的数据，防止vue在最后一页删除时，数据不对的问题\npagehelper:\n  reasonable: true\n\n# biz:\n#   oss:\n#     # resources-url是带有bucket的\n#     resources-url: http://192.168.1.49:9000/mall4cloud\n#     type: 1\n#     endpoint: http://192.168.1.49:9000\n#     bucket: mall4cloud\n#     access-key-id: admin\n#     access-key-secret: admin123456\n\nfeign:\n  client:\n    config:\n      default:\n        connectTimeout: 5000\n        readTimeout: 5000\n        loggerLevel: basic\n  sentinel:\n    enabled: true\n  # hystrix:\n  #   enabled: true\n#   inside:\n#     key: mall4cloud-feign-inside-key\n#     secret: mall4cloud-feign-inside-secret\n#     # ip白名单，如果有需要的话，用小写逗号分割\n#     ips: \n\n# mall4cloud:\n#   job:\n#     accessToken:\n#     admin:\n#       addresses: http://192.168.1.49:8999\n\n# rocketmq:\n#   name-server: 192.168.1.49:9876', 'b7e128a88837b73f3d9da7c5bc9645db', '2022-08-19 09:41:04', '2022-08-23 06:28:58', NULL, '110.184.67.227', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (4164, 'cjxycloud-gateway-dev.yml', 'DEFAULT_GROUP', 'spring:\n  cloud:\n    gateway:\n      globalcors:\n        cors-configurations:\n          \'[/**]\':\n            allow-credentials: true\n            allowed-headers: \"*\"\n            # 半个月内都允许\n            max-age: 1296000\n            # 测试环境，全部允许\n            allowedOriginPatterns: \"*\"\n            # allowedOrigins:\n              # - \"http://localhost:9527\"\n              # - \"http://localhost:9527\"\n              # - \"http://localhost:9528\"\n              # - \"http://localhost:9529\"\n              # - \"http://:9527\"\n            allowedMethods:\n              - GET\n              - POST\n              - PUT\n              - OPTIONS\n              - DELETE\n      discovery:\n        locator:\n          # 开启服务注册和发现\n          enabled: true\n          # 不手动写路由的话，swagger整合不了...\n      routes:\n        - id: auth-service\n          uri: lb://cjxycloud-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            - StripPrefix=1\n            \n        - id: website-service\n          uri: lb://cjxycloud-website\n          predicates:\n            - Path=/website/**\n          filters:\n            - StripPrefix=1\n', 'fb465531a4f49859455050c540b1de81', '2022-08-19 09:42:21', '2022-08-24 04:49:08', NULL, '110.185.17.139', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (4165, 'cjxycloud-auth-dev.yml', 'DEFAULT_GROUP', 'spring:\n  datasource:\n    url: jdbc:mysql://aliyun.xiaowenhao.ren:3306/cjxycloud_auth?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=GMT%2B8&allowMultiQueries=true&allowPublicKeyRetrieval=true&useAffectedRows=true\n    username: root\n    password: 4234', '7c3cd3a7709e75544590d1796dd7a6f7', '2022-08-19 09:48:29', '2022-08-19 09:48:29', NULL, '125.70.179.138', '', '', NULL, NULL, NULL, 'yaml', NULL);
