INSERT INTO `his_config_info` VALUES (4129, 4436, 'application-dev.yml', 'DEFAULT_GROUP', '', '# 数据源\nxiaowenhao:\n  name: \"xiaowenhao\"\nspring:\n  #避免nacos取网卡出错\n#   cloud:\n#     inetutils:\n#       preferred-networks: 192.168.1\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    type: com.zaxxer.hikari.HikariDataSource\n    hikari:\n      minimum-idle: 0\n      maximum-pool-size: 20\n      idle-timeout: 25000\n      auto-commit: true\n      connection-test-query: SELECT 1\n  redis:\n    host: aliyun.xiaowenhao.ren\n    password: 4234\n  jackson:\n    date-format: yyyy-MM-dd HH:mm:ss\n    time-zone: GMT+8\n      \n#mybatis的相关配置\nmybatis:\n  #mapper配置文件\n  mapper-locations: classpath:mapper/*Mapper.xml\n  type-aliases-package: com.haolinmeng.cloud.**.model\n  #开启驼峰命名\n  configuration:\n    map-underscore-to-camel-case: true\n\nseata:\n  # tx-service-group: my_test_tx_group\n  # config:\n  #   type: nacos\n  #   nacos:\n  #     namespace: \"\"\n  #     server-addr: ${spring.cloud.nacos.discovery.server-addr}\n  #     password: ${spring.cloud.nacos.discovery.password}\n  #     username: ${spring.cloud.nacos.discovery.username}\n  registry:\n    type: nacos\n    nacos:\n      server-addr: ${spring.cloud.nacos.discovery.server-addr}\n      username: ${spring.cloud.nacos.discovery.username}\n      password: ${spring.cloud.nacos.discovery.password}\n      namespace: \"\"\n      group: DEFAULT_GROUP\n      application: hlmcloud-seata\n  tx-service-group: seata-demo\n  service:\n    vgroup-mapping:\n      seata-demo: default\n\nlogging:\n  level:\n    root: info\n    com:\n      hlmcloud:\n        shop: debug\n# 分页合理化，当查询到页码大于最后一页的时候，返回最后一页的数据，防止vue在最后一页删除时，数据不对的问题\npagehelper:\n  reasonable: true\n\n# biz:\n#   oss:\n#     # resources-url是带有bucket的\n#     resources-url: http://192.168.1.49:9000/mall4cloud\n#     type: 1\n#     endpoint: http://192.168.1.49:9000\n#     bucket: mall4cloud\n#     access-key-id: admin\n#     access-key-secret: admin123456\n\nfeign:\n  client:\n    config:\n      default:\n        connectTimeout: 5000\n        readTimeout: 5000\n        loggerLevel: basic\n  hystrix:\n    enabled: true\n#   inside:\n#     key: mall4cloud-feign-inside-key\n#     secret: mall4cloud-feign-inside-secret\n#     # ip白名单，如果有需要的话，用小写逗号分割\n#     ips: \n\n# mall4cloud:\n#   job:\n#     accessToken:\n#     admin:\n#       addresses: http://192.168.1.49:8999\n\n# rocketmq:\n#   name-server: 192.168.1.49:9876', 'ac22a7742fef30a4e82e78e322259f05', '2022-08-19 17:37:43', '2022-08-19 09:37:43', NULL, '125.70.179.138', 'D', '');
