INSERT INTO `his_config_info` VALUES (4164, 4452, 'cjxycloud-gateway-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    gateway:\n      globalcors:\n        cors-configurations:\n          \'[/**]\':\n            allow-credentials: true\n            allowed-headers: \"*\"\n            # 半个月内都允许\n            max-age: 1296000\n            # 测试环境，全部允许\n            allowedOriginPatterns: \"*\"\n            # allowedOrigins:\n              # - \"http://localhost:9527\"\n              # - \"http://localhost:9527\"\n              # - \"http://localhost:9528\"\n              # - \"http://localhost:9529\"\n              # - \"http://:9527\"\n            allowedMethods:\n              - GET\n              - POST\n              - PUT\n              - OPTIONS\n              - DELETE\n      discovery:\n        locator:\n          # 开启服务注册和发现\n          enabled: true\n          # 不手动写路由的话，swagger整合不了...\n      routes:\n        - id: auth-service\n          uri: lb://cjxycloud-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            - StripPrefix=1\n', 'c3905e178daca7fff8d1d1582280c000', '2022-08-24 12:37:53', '2022-08-24 04:37:53', NULL, '110.185.17.139', 'U', '');
